/*******************************************************************************
 * @description    : 리스트 조회 - 이벤트
*******************************************************************************/
function div_search_btn_search_OnClick(obj)
{
	if(f_isValidSearch() == false) return;

	ds_Condition.Clear();

	// 넘길 파라메터 설정
	var sWorkingDate;
	var sStrdMonth = div_search.cal_StrdYM.Value;					// 기준 월
	var sPrevMonth = substr(addMonth(sStrdMonth + "01", -1), 0, 6);	// 전월

	if (sStrdMonth == substr(ToDay(), 0, 6))
	{
		sWorkingDate = ToDay();
	} else {
		sWorkingDate = addDate(addMonth(sStrdMonth + "01", 1), -1);
	}

	cf_setParam(ds_Condition, "STRD_YM", sStrdMonth);
	cf_setParam(ds_Condition, "PREV_YM", sPrevMonth);
	cf_setParam(ds_Condition, "STRD_DT", sWorkingDate);

	// 트랜잭션 설정
	var sSvcID  = "svcList";
	var sInDs   = "nc_input_fieldDs=ds_Condition";
	var sOutDs  = "ds_SalesDayCount=ds_SalesDayCount ";
	    sOutDs += "ds_JipyoPrevMonth=ds_JipyoPrevMonth ";
	    sOutDs += "ds_JipyoStrdMonth=ds_JipyoStrdMonth ";
	    sOutDs += "ds_JipyoStrdDay=ds_JipyoStrdDay ";
	    sOutDs += "ds_OrgPrevMonth=ds_OrgPrevMonth ";
	    sOutDs += "ds_OrgStrdMonth=ds_OrgStrdMonth ";
	    sOutDs += "ds_OrgStrdDay=ds_OrgStrdDay";
	var sArg    = "sktst.sal.STA#getSALSTA02000";

	// 공통 트랜잭션 호출
	cf_Transaction(sSvcID, sInDs, sOutDs, sArg, "", true, true);
}



/*******************************************************************************
* 기능명 : 조회 유효성
*******************************************************************************/
function f_isValidSearch()
{
	if(uf_isNull(div_search.cal_StrdYM.Value) == true)
	{
		alert("기준년월를 선택하시오.");
		div_search.cal_StrdYM.SetFocus();
		return false;
	}
	return true;
}
/*******************************************************************************
 * @description    : 콜백
 * @param sSvcID   : 서비스 아이디
*******************************************************************************/
function f_callBack(sSvcID)
{	

	switch(sSvcID)
	{
	case "svcList":
		var sPrevMonth = ds_SalesDayCount.GetColumn(0, "PREV_SALES_DAY");
		var sStrdMonth = ds_SalesDayCount.GetColumn(0, "STRD_SALES_DAY");
		var sStrdDay   = ds_SalesDayCount.GetColumn(0, "STRD_DAY");

		stc_MonthInfo.Text = "전월 영업일수 : " + sPrevMonth + "  당월 영업일수 : " + sStrdMonth + " 경과일수 : " + sStrdDay;
		f_setGridData();
		break;		

	default:
		break;
	}
}

