/*******************************************************************************
 * @description    : 엑셀 출력 - 이벤트
*******************************************************************************/
function f_setGridData()
{
	var sScrbCnt;
	var sEqpChgCnt;

	// 전월, 당월 및 당일 영업일수
	var sPrevMonth = ds_SalesDayCount.GetColumn(0, "PREV_SALES_DAY");
	var sStrdMonth = ds_SalesDayCount.GetColumn(0, "STRD_SALES_DAY");
	var sStrdDay   = ds_SalesDayCount.GetColumn(0, "STRD_DAY");

	ds_list.ClearData();
	if (ds_list.rowcount == 0) {;
		ds_list.AddRow();
	}

	grd_list.Redraw = false;

	// 지표별 - 전월
    ds_list.SetColumn(0,"GNRL_SCRB_CNT_F", ds_JipyoPrevMonth.GetColumn(0,"GNRL_SCRB_CNT"));     // 신규 - 010
    ds_list.SetColumn(0,"MNP_KT_MNP_F",    ds_JipyoPrevMonth.GetColumn(0,"MNP_KT_MNP"));        //        번호이동 - KT
    ds_list.SetColumn(0,"MNP_LGT_MNP_F",   ds_JipyoPrevMonth.GetColumn(0,"MNP_LGT_MNP"));       //                   LGT
    ds_list.SetColumn(0,"MNP_SCRB_CNT_F",  ds_JipyoPrevMonth.GetColumn(0,"MNP_SCRB_CNT"));      //        번호이동 계
    ds_list.SetColumn(0,"SCRB_CNT_F",      ds_JipyoPrevMonth.GetColumn(0,"SCRB_CNT"));          // 신규 계
    ds_list.SetColumn(0,"GNRL_TERM_CNT_F", ds_JipyoPrevMonth.GetColumn(0,"GNRL_TERM_CNT"));     // 해지 - 일반해지
    ds_list.SetColumn(0,"MNP_KT_TERM_F",   ds_JipyoPrevMonth.GetColumn(0,"MNP_KT_TERM"));       //        번호이동 - KT
    ds_list.SetColumn(0,"MNP_LGT_TERM_F",  ds_JipyoPrevMonth.GetColumn(0,"MNP_LGT_TERM"));      //                   LGT
    ds_list.SetColumn(0,"MNP_TERM_CNT_F",  ds_JipyoPrevMonth.GetColumn(0,"MNP_TERM_CNT"));      //        번호이동 계
    ds_list.SetColumn(0,"AUTH_TERM_CNT_F", ds_JipyoPrevMonth.GetColumn(0,"AUTH_TERM_CNT"));     //        직권해지
    ds_list.SetColumn(0,"TERM_CNT_F",      ds_JipyoPrevMonth.GetColumn(0,"TERM_CNT"));          // 해지 계
    ds_list.SetColumn(0,"REAL_ADD_CNT_F",  ds_JipyoPrevMonth.GetColumn(0,"REAL_ADD_CNT"));      // 순증 - 총계
    ds_list.SetColumn(0,"GNRL_REAL_ADD_F", ds_JipyoPrevMonth.GetColumn(0,"GNRL_REAL_ADD"));     //        010
    ds_list.SetColumn(0,"KT_REAL_TERM_F",  ds_JipyoPrevMonth.GetColumn(0,"KT_REAL_TERM"));      //        번호이동 - KT
    ds_list.SetColumn(0,"LGT_REAL_TERM_F", ds_JipyoPrevMonth.GetColumn(0,"LGT_REAL_TERM"));     //                   LGT
    ds_list.SetColumn(0,"MNP_REAL_TERM_F", ds_JipyoPrevMonth.GetColumn(0,"MNP_REAL_TERM"));     //        번호이동계
    ds_list.SetColumn(0,"EQP_CHG_CNT_F",   ds_JipyoPrevMonth.GetColumn(0,"EQP_CHG_CNT"));       // 기변 - 보상 + 일반 + 현금
    ds_list.SetColumn(0,"EQP_CHG_RATE_F",  round(ds_JipyoPrevMonth.GetColumn(0,"EQP_CHG_RATE"), 2));      //        기변 / 신규
    ds_list.SetColumn(0,"DMB_SVC_F",       ds_JipyoPrevMonth.GetColumn(0,"DMB_SVC"));           // DMB  - 서비스
    ds_list.SetColumn(0,"DMB_EQP_F",       ds_JipyoPrevMonth.GetColumn(0,"DMB_EQP"));           //        단말기
    ds_list.SetColumn(0,"WCDMA_CNT_F",     ds_JipyoPrevMonth.GetColumn(0,"WCDMA_CNT"));         // WCDMA
    ds_list.SetColumn(0,"TOTAL_CNT_F",     ds_JipyoPrevMonth.GetColumn(0,"TOTAL_CNT"));         // 전사 계 - 신규 + 기변

	//        전월 일평균
    if (sPrevMonth == 0) {
        ds_list.SetColumn(0, "GNRL_SCRB_CNT_G", 0);
        ds_list.SetColumn(0, "MNP_KT_MNP_G",    0);
        ds_list.SetColumn(0, "MNP_LGT_MNP_G",   0);
        ds_list.SetColumn(0, "MNP_SCRB_CNT_G",  0);
        ds_list.SetColumn(0, "SCRB_CNT_G",      0);
        ds_list.SetColumn(0, "GNRL_TERM_CNT_G", 0);
        ds_list.SetColumn(0, "MNP_KT_TERM_G",   0);
        ds_list.SetColumn(0, "MNP_LGT_TERM_G",  0);
        ds_list.SetColumn(0, "MNP_TERM_CNT_G",  0);
        ds_list.SetColumn(0, "AUTH_TERM_CNT_G", 0);
        ds_list.SetColumn(0, "TERM_CNT_G",      0);
        ds_list.SetColumn(0, "REAL_ADD_CNT_G",  0);
        ds_list.SetColumn(0, "GNRL_REAL_ADD_G", 0);
        ds_list.SetColumn(0, "KT_REAL_TERM_G",  0);
        ds_list.SetColumn(0, "LGT_REAL_TERM_G", 0);
        ds_list.SetColumn(0, "MNP_REAL_TERM_G", 0);
        ds_list.SetColumn(0, "EQP_CHG_CNT_G",   0);
        ds_list.SetColumn(0, "EQP_CHG_RATE_G",  0);
        ds_list.SetColumn(0, "DMB_SVC_G",       0);
        ds_list.SetColumn(0, "DMB_EQP_G",       0);
        ds_list.SetColumn(0, "WCDMA_CNT_G",     0);
        ds_list.SetColumn(0, "TOTAL_CNT_G",     0);
    } else {
	    sScrbCnt   = round(ds_JipyoPrevMonth.GetColumn(0,"SCRB_CNT")   / sPrevMonth);
	    sEqpChgCnt = round(ds_JipyoPrevMonth.GetColumn(0,"EQP_CHG_CNT")      / sPrevMonth);
        ds_list.SetColumn(0, "GNRL_SCRB_CNT_G", round(ds_JipyoPrevMonth.GetColumn(0,"GNRL_SCRB_CNT") / sPrevMonth));
        ds_list.SetColumn(0, "MNP_KT_MNP_G",    round(ds_JipyoPrevMonth.GetColumn(0,"MNP_KT_MNP")    / sPrevMonth));
        ds_list.SetColumn(0, "MNP_LGT_MNP_G",   round(ds_JipyoPrevMonth.GetColumn(0,"MNP_LGT_MNP")   / sPrevMonth));
        ds_list.SetColumn(0, "MNP_SCRB_CNT_G",  round(ds_JipyoPrevMonth.GetColumn(0,"MNP_SCRB_CNT")  / sPrevMonth));
        ds_list.SetColumn(0, "SCRB_CNT_G",      round(ds_JipyoPrevMonth.GetColumn(0,"SCRB_CNT")      / sPrevMonth));
        ds_list.SetColumn(0, "GNRL_TERM_CNT_G", round(ds_JipyoPrevMonth.GetColumn(0,"GNRL_TERM_CNT") / sPrevMonth));
        ds_list.SetColumn(0, "MNP_KT_TERM_G",   round(ds_JipyoPrevMonth.GetColumn(0,"MNP_KT_TERM")   / sPrevMonth));
        ds_list.SetColumn(0, "MNP_LGT_TERM_G",  round(ds_JipyoPrevMonth.GetColumn(0,"MNP_LGT_TERM")  / sPrevMonth));
        ds_list.SetColumn(0, "MNP_TERM_CNT_G",  round(ds_JipyoPrevMonth.GetColumn(0,"MNP_TERM_CNT")  / sPrevMonth));
        ds_list.SetColumn(0, "AUTH_TERM_CNT_G", round(ds_JipyoPrevMonth.GetColumn(0,"AUTH_TERM_CNT") / sPrevMonth));
        ds_list.SetColumn(0, "TERM_CNT_G",      round(ds_JipyoPrevMonth.GetColumn(0,"TERM_CNT")      / sPrevMonth));
        ds_list.SetColumn(0, "REAL_ADD_CNT_G",  round(ds_JipyoPrevMonth.GetColumn(0,"REAL_ADD_CNT")  / sPrevMonth));
        ds_list.SetColumn(0, "GNRL_REAL_ADD_G", round(ds_JipyoPrevMonth.GetColumn(0,"GNRL_REAL_ADD") / sPrevMonth));
        ds_list.SetColumn(0, "KT_REAL_TERM_G",  round(ds_JipyoPrevMonth.GetColumn(0,"KT_REAL_TERM")  / sPrevMonth));
        ds_list.SetColumn(0, "LGT_REAL_TERM_G", round(ds_JipyoPrevMonth.GetColumn(0,"LGT_REAL_TERM") / sPrevMonth));
        ds_list.SetColumn(0, "MNP_REAL_TERM_G", round(ds_JipyoPrevMonth.GetColumn(0,"MNP_REAL_TERM") / sPrevMonth));
        ds_list.SetColumn(0, "EQP_CHG_CNT_G",   round(ds_JipyoPrevMonth.GetColumn(0,"EQP_CHG_CNT")   / sPrevMonth));
        ds_list.SetColumn(0, "EQP_CHG_RATE_G",  round(sEqpChgCnt * 100 / sScrbCnt, 2));
        ds_list.SetColumn(0, "DMB_SVC_G",       round(ds_JipyoPrevMonth.GetColumn(0,"DMB_SVC")      / sPrevMonth));
        ds_list.SetColumn(0, "DMB_EQP_G",       round(ds_JipyoPrevMonth.GetColumn(0,"DMB_EQP")      / sPrevMonth));
        ds_list.SetColumn(0, "WCDMA_CNT_G",     round(ds_JipyoPrevMonth.GetColumn(0,"WCDMA_CNT")     / sPrevMonth));
        ds_list.SetColumn(0, "TOTAL_CNT_G",     round(ds_JipyoPrevMonth.GetColumn(0,"TOTAL_CNT")     / sPrevMonth));
    }

	// 지표별 - 누계가입자                                                   
    ds_list.SetColumn(0, "GNRL_SCRB_CNT_H", 0);
    ds_list.SetColumn(0, "MNP_KT_MNP_H",    0);
    ds_list.SetColumn(0, "MNP_LGT_MNP_H",   0);
    ds_list.SetColumn(0, "MNP_SCRB_CNT_H",  0);
    ds_list.SetColumn(0, "SCRB_CNT_H",      0);
    ds_list.SetColumn(0, "GNRL_TERM_CNT_H", 0);
    ds_list.SetColumn(0, "MNP_KT_TERM_H",   0);
    ds_list.SetColumn(0, "MNP_LGT_TERM_H",  0);
    ds_list.SetColumn(0, "MNP_TERM_CNT_H",  0);
    ds_list.SetColumn(0, "AUTH_TERM_CNT_H", 0);
    ds_list.SetColumn(0, "TERM_CNT_H",      0);
    ds_list.SetColumn(0, "REAL_ADD_CNT_H",  0);
    ds_list.SetColumn(0, "GNRL_REAL_ADD_H", 0);
    ds_list.SetColumn(0, "KT_REAL_TERM_H",  0);
    ds_list.SetColumn(0, "LGT_REAL_TERM_H", 0);
    ds_list.SetColumn(0, "MNP_REAL_TERM_H", 0);
    ds_list.SetColumn(0, "EQP_CHG_CNT_H",   0);
    ds_list.SetColumn(0, "EQP_CHG_RATE_H",  0);
    ds_list.SetColumn(0, "DMB_SVC_H",       0);
    ds_list.SetColumn(0, "DMB_EQP_H",       0);
    ds_list.SetColumn(0, "WCDMA_CNT_H",     0);
    ds_list.SetColumn(0, "TOTAL_CNT_H",     0);

	// 목표
    ds_list.SetColumn(0, "GNRL_SCRB_CNT_I", 0);
    ds_list.SetColumn(0, "MNP_KT_MNP_I",    0);
    ds_list.SetColumn(0, "MNP_LGT_MNP_I",   0);
    ds_list.SetColumn(0, "MNP_SCRB_CNT_I",  0);
    ds_list.SetColumn(0, "SCRB_CNT_I",      0);
    ds_list.SetColumn(0, "GNRL_TERM_CNT_I", 0);
    ds_list.SetColumn(0, "MNP_KT_TERM_I",   0);
    ds_list.SetColumn(0, "MNP_LGT_TERM_I",  0);
    ds_list.SetColumn(0, "MNP_TERM_CNT_I",  0);
    ds_list.SetColumn(0, "AUTH_TERM_CNT_I", 0);
    ds_list.SetColumn(0, "TERM_CNT_I",      0);
    ds_list.SetColumn(0, "REAL_ADD_CNT_I",  0);
    ds_list.SetColumn(0, "GNRL_REAL_ADD_I", 0);
    ds_list.SetColumn(0, "KT_REAL_TERM_I",  0);
    ds_list.SetColumn(0, "LGT_REAL_TERM_I", 0);
    ds_list.SetColumn(0, "MNP_REAL_TERM_I", 0);
    ds_list.SetColumn(0, "EQP_CHG_CNT_I",   0);
    ds_list.SetColumn(0, "EQP_CHG_RATE_I",  0);
    ds_list.SetColumn(0, "DMB_SVC_I",       0);
    ds_list.SetColumn(0, "DMB_EQP_I",       0);
    ds_list.SetColumn(0, "WCDMA_CNT_I",     0);
    ds_list.SetColumn(0, "TOTAL_CNT_I",     0);

	// 합계
    ds_list.SetColumn(0,"GNRL_SCRB_CNT_J", ds_JipyoStrdMonth.GetColumn(0,"GNRL_SCRB_CNT"));     // 신규 - 010
    ds_list.SetColumn(0,"MNP_KT_MNP_J",    ds_JipyoStrdMonth.GetColumn(0,"MNP_KT_MNP"));        //        번호이동 - KT
    ds_list.SetColumn(0,"MNP_LGT_MNP_J",   ds_JipyoStrdMonth.GetColumn(0,"MNP_LGT_MNP"));       //                   LGT
    ds_list.SetColumn(0,"MNP_SCRB_CNT_J",  ds_JipyoStrdMonth.GetColumn(0,"MNP_SCRB_CNT"));      //        번호이동 계
    ds_list.SetColumn(0,"SCRB_CNT_J",      ds_JipyoStrdMonth.GetColumn(0,"SCRB_CNT"));          // 신규 계
    ds_list.SetColumn(0,"GNRL_TERM_CNT_J", ds_JipyoStrdMonth.GetColumn(0,"GNRL_TERM_CNT"));     // 해지 - 일반해지
    ds_list.SetColumn(0,"MNP_KT_TERM_J",   ds_JipyoStrdMonth.GetColumn(0,"MNP_KT_TERM"));       //        번호이동 - KT
